import { SettingDecoratorConverter } from "src/app/_base/decorators/setting.decorator";
import { EnviromentSelectNgModelType, EnviromentSelectStoreType } from "./enviroment-select.interfaces";


export  class EnviromentSelectSettingDecoratorConverter 
        implements SettingDecoratorConverter<EnviromentSelectNgModelType, EnviromentSelectStoreType> 
{
    storeConversion(content : EnviromentSelectStoreType) : EnviromentSelectNgModelType {
        if (content === undefined) {
            return undefined;
        }
        return content
            .map((x) => ({
                id: x.id,
                name: x.name
            }));
    }

    // no data trasfer from presentation layer to data layer
    modelConversion(content : EnviromentSelectNgModelType) : undefined {
        return undefined;
    }
}
